    private static readonly ushort[] ValueToUnicode = DecodeBase64(ValueToUnicodeBase64);
    private static Dictionary<char, ushort>? s_unicodeToValue;

    internal static bool TryGetUnicode(ushort value, out char c) {
        if (value < ValueToUnicode.Length) {
            var u = ValueToUnicode[value];
            if (u != 0) {
                c = (char)u;
                return true;
            }
        }
        c = '\0';
        return false;
    }

    internal static bool TryGetValue(char c, out ushort value) {
        var map = s_unicodeToValue ??= BuildUnicodeToValue();
        return map.TryGetValue(c, out value);
    }

    private static Dictionary<char, ushort> BuildUnicodeToValue() {
        var map = new Dictionary<char, ushort>(ValueToUnicode.Length);
        for (ushort i = 0; i < ValueToUnicode.Length; i++) {
            var u = ValueToUnicode[i];
            if (u == 0) continue;
            var ch = (char)u;
            if (!map.ContainsKey(ch)) map[ch] = i;
        }
        return map;
    }

    private static ushort[] DecodeBase64(string data) {
        var bytes = Convert.FromBase64String(data);
        var result = new ushort[bytes.Length / 2];
        for (var i = 0; i < result.Length; i++) {
            var lo = bytes[i * 2];
            var hi = bytes[i * 2 + 1];
            result[i] = (ushort)(lo | (hi << 8));
        }
        return result;
    }
